import React from 'react';
import styled from 'styled-components';

function Header() {
    return (
        <div>
           <Container>
                <img src="/images/logo.svg" alt="" />

                <Menu>
            <a href="#">Model S</a>
            <a href="#">Model S</a>
            <a href="#">Model S</a>
            <a href="#">Model S</a>

           </Menu>
           <RightMenu>
           <a href="#">Shop</a>
            <a href="#">Tesla Account</a>
           </RightMenu>
           </Container>

        </div>
    )
}

export default Header

const Container = styled.div`
  min-height:50px;
  position:fixed;
  display:flex;
  align-item:center;
  padding: 0 20px;
  top:0;
  left:0;
  right:0;

`

const Menu = styled.div`
 display:flex;
 padding-top:10px;
 align-items:center;
 justify-content:center;
 flex:1;
 a{
     font-weight:600;
     color:black;
     text-transform:uppercase;
     padding:0 10px;
     flex-wrap:nowrap;
    }

`
const RightMenu = styled.div`
display:flex;
padding-top:10px;
align-items:center;
a{
    font-weight:600;
    color:black;
    text-transform:uppercase;
    margin-top:10px;
    flex-wrap:nowrap;
   }
`
